using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace _3.LongestSubstringWithoutRepeatingChars
{
    static class Solution
    {
        public static int FindLongestSubstring(string s)
        {
            int i = 0, j = 0;
            int n = s.Length;
            int[] c = s.ToCharArray().ToList().ConvertAll<int>(a => { return (int)a; }).ToArray();
            //Tried a HashSet<char> originally, was really slow. Probably not super efficient to use linq
            HashSet<int> hs = new HashSet<int>();
            int len = 0;
            while (i < n && j < n)
            {
                if (!hs.Contains(c[j]))
                {
                    hs.Add(c[j++]);
                    len = (len > (j - i)) ? len : (j - i);
                }
                else
                {
                    hs.Remove(c[i++]);
                    
                }
                
            }
            return len;
        }

        //First solution - brute force:
        public static int FindLongestSubstringBruteForce(string s)
        {
            List<char> past = new List<char>();
            char curr;
            int currLen = 0;
            int maxLen = 0;
            char[] chars = s.ToCharArray();
            int i = 0;
            int currLengthIterator = 0;

            if (s.Length == 0)
            {
                return 0;
            }

            while (true)
            {
                curr = chars[i];
                currLen = 1;
                currLengthIterator = i + 1;
                while (true)
                {

                    //End conditions
                    if (currLengthIterator >= chars.Length)
                    {
                        break;
                    }


                    char next = chars[currLengthIterator];

                    if (curr == next)
                    {
                        break;
                    }
                    else if (past.Contains(next))
                    {
                        break;
                    }
                    else
                    {
                        //Continue
                        currLen++;
                        currLengthIterator++;
                        past.Add(next);
                    }

                    //End while
                }

                if (currLen > maxLen)
                {
                    maxLen = currLen;
                }

                if (i + 1 > chars.Length - 1)
                {
                    break;
                }

                i++;
                past = new List<char>();
            }  //End While

            return maxLen;
        }

    }

